  // Delete Sales Order Dialog events
  bmlfonDialogAction(psAction) {
    if (psAction == 'No') {
      this.mbShowDeleteDialog = false;
    } else if (psAction == 'Yes') {
      if (this.msFormMode == "I") {
        this.bmlfRefreshForm();
        return false;
      }
      let parrHeaderData = [];
      parrHeaderData = [{
        ItemKey: this.mobjCustomFieldHeader.ItemKey
      }];
      let reqData = {
        JSON: JSON.stringify({
          ParaData: parrHeaderData,
          Response: [{
            "ResponseText": "",
            "ErrorCode": ""
          }]
        })
      };
      this.formService.bmlfDeleteCustomFields(reqData).subscribe(res => {
        if (res == null) {
          this.toastMessageService.notifyError(this.utilService.bmgfonTranslate('COMMON.MSG.SERVERERROR'));
          return false;
        }
        if (res.Response[0].ErrorCode == "") {
          {
            this.toastMessageService.notifySuccess(this.utilService.bmgfonTranslate('COMMON.MSG.DELETE'));
            this.mbShowDeleteDialog = false;
            let deleteKey = this.msScreenName + " — " + this.msItemKey;
            this.FieldExtender.bmgfDeleteData(deleteKey);
            this.bmlfRefreshForm();
          }
        } else {
          this.toastMessageService.notifyError(res.Response[0].ResponseText);
          this.mbShowDeleteDialog = false;
        }
      });
    }
  }
  bmlfOpenSelectedRecord(data) {
    let param = {
      ItemKey: data.ItemKey
    };
    this.utilService.bmgfRefreshReuse('/main/sds/custom-fields/manage', true, param);
  }
  // Refresh Sales Order
  bmlfRefreshForm() {
    this.utilService.bmgfRefreshReuse('/main/sds/custom-fields/manage', false);
  }
  // Copy Current Data
  bmlfCopyData() {
    let HeaderData = Object.assign({}, this.mobjCustomFieldHeader);
    HeaderData.ItemKey = "";
    HeaderData.Desc1 = "";
    let parrCopyData = {
      HeaderData: HeaderData,
      grpKey: this.mobjCustomFieldHeader.ItemKey,
      DetailGrid: this.mArrCustomFieldGrid
    };
    localStorage.setItem('copyCustomKeyData', JSON.stringify(parrCopyData));
    this.bmlfRefreshForm();
  }
