  /**-------Call Save service from here-------------- */
  bmlfSaveMatSafetyData() {
    this.mbIsLoading = true;
    let parrHeaderData = [];
    let pobjData = this.mobjCommonFormObject.formObject;
    parrHeaderData.push(pobjData);
    let parrItemLocData = Object.assign([], this.marrItemLocaData);
    let parrMatHazData = Object.assign([], this.marrMaterialHazardData);
    let parrOELData = Object.assign([], this.marrOELData);
    let pobjJData = {
      HeaderData: parrHeaderData,
      ItemLoc: parrItemLocData,
      MatHaz: parrMatHazData,
      OEL: parrOELData,
      Response: [{
        "ResponseText": "",
        "ErrorCode": ""
      }]
    };
    let pobjJson = {
      JSON: JSON.stringify(pobjJData)
    };
    this.formService.bmlfSaveMaterialSafetyInformation(pobjJson, this.msFormMode).subscribe(res => {
      this.mbIsLoading = false;
      if (res.Response[0].ErrorCode == "") {
        this.FieldExtender.mbChange = false;
        this.customCtrl.mbChange = false;
        this.mbIsChangeData = false;
        if (this.msFormMode == "I") {
          this.msFormMode = "U";
          this.msCopyRecord = "N";
          this.mobjCASNo.Itemkey = res.HeaderData[0].Itemkey;
          this.msItemKey = this.mobjCASNo.Itemkey;
          this.toastMessageService.notifySuccess(this.utilService.bmgfonTranslate("COMMON.MSG.SAVE"));
        } else if (this.msFormMode == "U") {
          this.toastMessageService.notifySuccess(this.utilService.bmgfonTranslate("COMMON.MSG.EDIT"));
        }
        // FieldExtender -- start update
        let screenKeyValue = this.msScreenName + " — " + this.msItemKey;
        let jsonData = this.FieldExtender.bmlfSaveData(screenKeyValue);
        if (jsonData.length > 0) {
          this.FieldExtender.bmlfCallApi(jsonData).then(res => {
            if (res != null) {}
          });
        }
        ;
        this.footerComponent.bmlfFooterEndCustomService(); // call footer end service
        // FieldExtender -- End update
        if (this.mbIsSearchMode) {
          this.mbIsSearchMode = false;
          this.bmlfOpenLookupModal('MaterialSafetyInformationList', this.msScreenName, 'MaterialSafetyInformationList', 'click', '', 'custom', 'cmdSearch', 'CASNUMBER.TITLEMAT');
        } else if (this.mbIsAddMode) {
          this.mbIsAddMode = false;
          this.bmlfRefreshForm();
        } else if (this.mbIsCopyMode) {
          this.mbIsCopyMode = false;
          this.bmlfCopyData();
        } else if (this.mbIsCloseMode) {
          this.mbIsCloseMode = false;
          this.router.navigate(["/main/sds/material-safety-info"]);
        } else {
          this.bmlfGetMatSafetyInfoData();
        }
      } else {
        this.mbIsSearchMode = false;
        this.mbIsAddMode = false;
        this.mbIsCopyMode = false;
        this.mbIsDeleteMode = false;
        this.mbIsCloseMode = false;
        this.toastMessageService.notifyError(res.Response[0].ResponseText);
      }
      console.log(res);
    }).add(() => {
      this.mbIsLoading = false;
    });
  }
