  /**-------Call Save service from here-------------- */
  bmlfSaveSDSKeywordInfo() {
    debugger;
    this.mbIsLoading = true;
    let parrParameterData = [{
      Mode: this.msFormMode == 'I' ? 'Insert' : 'Update'
    }];
    let parrHeaderData = [];
    // let parrDetailData=[];
    // this.mobjCommonFormObject.formObject.ItemImage = '';
    //   this.mobjCommonFormObject.formObject.ItemImageType = '';
    var psItemImage = this.msImage.split("base64,");
    if (psItemImage.length > 1) {
      this.mobjCommonFormObject.formObject.HType = psItemImage[0] + 'base64,';
      this.mobjCommonFormObject.formObject.HIMG = psItemImage[1];
    }
    this.marrGrid.forEach(ele => {
      ele.NKeyword = this.mobjSDSKeywordInformation.NKeyword;
    });
    this.mobjCommonFormObject.formObject.KeyType = this.mobjCommonFormObject.formObject.KeyType == true ? 'R' : 'N';
    let pobjData = this.mobjCommonFormObject.formObject;
    parrHeaderData.push(pobjData);
    let pobjJData = {
      HeaderData: parrHeaderData,
      DetailData: this.marrGrid,
      Response: [{
        "ResponseText": "",
        "ErrorCode": ""
      }]
    };
    let pobjJson = {
      JSON: JSON.stringify(pobjJData)
    };
    this.formService.bmlfSaveSDSKeywordInformation(pobjJson, this.msFormMode).subscribe(res => {
      this.mbIsLoading = false;
      if (res.Response[0].ErrorCode == "") {
        this.FieldExtender.mbChange = false;
        if (this.customCtrl != undefined) {
          this.customCtrl.mbChange = false;
        }
        this.mbIsChangeData = false;
        if (this.msFormMode == "I") {
          this.msFormMode = "U";
          this.msCopyRecord = "N";
          this.mobjSDSKeywordInformation.NKeyword = res.HeaderData[0].NKeyword;
          this.msGrpKey = this.mobjSDSKeywordInformation.NKeyword;
          this.toastMessageService.notifySuccess(this.utilService.bmgfonTranslate("COMMON.MSG.SAVE"));
        } else if (this.msFormMode == "U") {
          this.toastMessageService.notifySuccess(this.utilService.bmgfonTranslate("COMMON.MSG.EDIT"));
        }
        // FieldExtender -- start update
        let screenKeyValue = this.msScreenName + " — " + this.msGrpKey;
        let jsonData = this.FieldExtender.bmlfSaveData(screenKeyValue);
        if (jsonData.length > 0) {
          this.FieldExtender.bmlfCallApi(jsonData).then(res => {
            if (res != null) {}
          });
        }
        ;
        this.footerComponent.bmlfFooterEndCustomService(); // call footer end service
        // FieldExtender -- End update
        if (this.mbIsSearchMode) {
          this.mbIsSearchMode = false;
          this.bmlfOpenLookupModal('SDSKeywordInformationList', this.msScreenName, 'SDSKeywordInformationList', 'click', '', 'custom', 'cmdSearch', 'BOILERPLATEMAINTENANCE.TITLE');
        } else if (this.mbIsAddMode) {
          this.mbIsAddMode = false;
          this.bmlfRefreshForm();
        } else if (this.mbIsCopyMode) {
          this.mbIsCopyMode = false;
          this.bmlfCopyData();
        } else if (this.mbIsCloseMode) {
          this.mbIsCloseMode = false;
          this.router.navigate(["/main/sds/sds-keyword-information"]);
        }
        this.bmlfGetSDSKeyword(); //Bug 186259
        // else {
        //   this.bmlfGetSDSKeyword();
        // }
      } else {
        this.mbIsSearchMode = false;
        this.mbIsAddMode = false;
        this.mbIsCopyMode = false;
        this.mbIsDeleteMode = false;
        this.mbIsCloseMode = false;
        this.toastMessageService.notifyError(res.Response[0].ResponseText);
      }
      console.log(res);
    }).add(() => {
      this.mbIsLoading = false;
    });
  }
