  // LOOKUP MODAL 
  bmlfOpenLookupModal(psField, psScreenName, psLookUpKey, psEvent, psValue, psType, psEleId, psTitle = "", pnumRowIdx = null) {
    if (psField == 'ItemSubType' && src_app_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_1__.CustomValidator.bmgfNullCheckValidator(this.mArrGrid[pnumRowIdx]['ItemType'])) {
      this.toastMessageService.notifyError(this.utilService.bmgfonTranslate('SDSSETUP.MESSAGE.PLEASESELECTITEMTYP'));
      this.mArrGrid[pnumRowIdx]['ItemSubType'] = '';
      return;
    }
    this.mbIsLoading = true;
    this.marrLookupGridData = [];
    this.mobjLookupKeyData = {};
    psLookUpKey = this.bmlfonSetLookupKey(psField);
    this.mobjLookupKeyData.title = this.utilService.bmgfonTranslate(psTitle);
    if (psEvent == 'blur' && (psValue == undefined || psValue == '')) {
      this.mobjModal[psField] = "";
      if (psField == 'BPGroupIfNoBPS') {
        this.mobjModal.BPIDIfNoBPS = '';
      } else if (psField == 'BPGroupIfNoMat') {
        this.mobjModal.BPIDIfNoMat = '';
      } else if (psField == 'ItemTyp') {
        this.mobjPIDDescModal.ItemTypDesc = '';
        this.mobjModalPID.ItemSubTyp = '';
        this.mobjPIDDescModal.ItemSubTypDesc = '';
      } else if (psField == 'ItemSubTyp') {
        this.mobjPIDDescModal.ItemSubTypDesc = '';
      } else if (psField == 'LocationKey') {
        this.mobjPIDDescModal.LocationKeyDesc = '';
      } else if (psField == 'ItemClassKey') {
        this.mobjPIDDescModal.ItemClassKeyDesc = '';
      } else if (psField == 'RevAcct') {
        this.mobjPIDDescModal.RevAcctDesc = '';
      } else if (psField == 'COGSAcct') {
        this.mobjPIDDescModal.COGSAcctDesc = '';
      } else if (psField == 'FormulaStatusKey') {
        this.mobjPIDDescModal.FormulaStatusKeyDesc = '';
      } else if (psField == 'FormulaClassKey') {
        this.mobjPIDDescModal.FormulaClassKeyDesc = '';
      } else if (psField == 'Language') {
        this.mobjPIDDescModal.LanguageDesc = '';
      } else if (pnumRowIdx != null) {
        if (psField == 'ItemType') {
          this.mArrGrid[pnumRowIdx]['ItemSubType'] = '';
        }
      }
      this.mbIsLoading = false;
      return false;
    }
    let psReqData = {};
    if (psField == 'ItemSubType' || psField == 'ItemSubTyp') {
      psReqData = {
        ScreenName: psScreenName,
        LookUpKey: psLookUpKey,
        Filter1: psField == 'ItemSubType' ? this.mArrGrid[pnumRowIdx]['ItemType'] : this.mobjModalPID.ItemTyp,
        Filter2: "",
        Filter3: "",
        Filter4: '',
        Filter5: ''
      };
    } else {
      psReqData = {
        ScreenName: psScreenName,
        LookUpKey: psLookUpKey,
        Filter1: "",
        Filter2: "",
        Filter3: "",
        Filter4: '',
        Filter5: ''
      };
    }
    this.lookupService.getLookup(psReqData).subscribe(res => {
      this.mbIsLoading = false;
      if (res == null) {
        this.bmlfOpenErrorBlock('COMMON.MSG.NODATA');
        if (psField == 'ItemType' || psField == 'ItemSubType') {
          this.mArrGrid[pnumRowIdx][psField] = '';
        } else {
          this.mobjModalPID[psField] = '';
        }
        return false;
      }
      if (Object.entries(res).length > 0 && res.LookupData.length > 0) {
        res.LookupData.forEach(ele => {
          Object.keys(ele).forEach(key => {
            let psKey = key.toUpperCase();
            if (psKey.search('DATE') != -1) {
              if (ele[key] && ele[key] != '') {
                ele[key] = moment__WEBPACK_IMPORTED_MODULE_6__(ele[key]).format(this.msCustomDateFormat.toUpperCase());
              } else {
                ele[key] = moment__WEBPACK_IMPORTED_MODULE_6__().format(this.msCustomDateFormat.toUpperCase());
              }
            }
          });
        });
        this.marrLookupGridData = res.LookupData;
        this.mnumLineItemRowIndex = pnumRowIdx;
        this.mobjLookupKeyData.field = psField;
        this.mobjLookupKeyData.gridData = this.marrLookupGridData;
        this.mobjLookupKeyData.type = psType;
        this.mobjLookupKeyData.eleId = psEleId;
        if (psValue) {
          this.mobjLookupKeyData.searchValue = psValue.toString();
        } else {
          this.mobjLookupKeyData.searchValue = '';
        }
        if (psEvent == 'blur' && psValue) {
          let parrFilterdArr = [];
          /** --- Check : enter key matching record found. if find single row then direct call save lookup function --*/
          let pobjFirstInput = Object.keys(this.marrLookupGridData[0])[0];
          parrFilterdArr = this.marrLookupGridData.filter(obj => {
            if (obj[pobjFirstInput].trim().toUpperCase() == psValue.trim().toUpperCase()) {
              return obj;
            }
          });
          if (parrFilterdArr.length == 1) {
            this.mobjLookupKeyData.value = parrFilterdArr[0];
            this.mobjLookupKeyData.valueKey = parrFilterdArr[0][pobjFirstInput];
            this.bmlfSaveLookupField(this.mobjLookupKeyData);
            this.mbIsLookupModal = false;
          } else {
            this.mbIsLookupModal = true;
          }
        } else if (psEvent == 'click') {
          this.mbIsLookupModal = true;
        }
      } else {
        this.bmlfOpenErrorBlock('COMMON.MSG.NODATA');
        //Bug 185572
        if (psField == 'ItemType' || psField == 'ItemSubType') {
          this.mArrGrid[pnumRowIdx][psField] = '';
        } else {
          this.mobjModalPID[psField] = '';
        }
      }
    }, err => {
      console.log(err);
      this.mbIsLoading = false;
    });
  }
