  // get Lookup Value Column
  bmlfGetInputColumn(psField) {
    if (psField == 'BPGroup') {
      return 'BPGroup';
    }
    if (psField == 'BPLang') {
      return 'LanguageId';
    }
    if (psField == 'ItemSubTyp') {
      return 'Itemsubtyp';
    }
    if (psField == 'ItemClassKey') {
      return 'Inclasskey';
    }
    if (psField == 'FormulaStatusKey') {
      return 'StatusID';
    }
    if (psField == 'FormulaClassKey') {
      return 'FormulaClassID';
    }
    if (psField == 'Language') {
      return 'Lang';
    }
    if (psField == 'COGSAcct' || psField == 'RevAcct') {
      return 'Acct';
    }
    if (psField == 'LocationKey') {
      return 'Location';
    } else if (psField == 'ItemType') {
      return 'Itemtyp';
    } else if (psField == 'ItemSubType') {
      return 'Itemsubtyp';
    } //Bug 185572
    else if (psField == 'BPGroupIfNoBPS' || psField == 'BPGroupIfNoMat') {
      return 'BPGroup';
    }
  }
