  bmlfCloseLookupModal(pobjEvent) {
    this.mbIsLookupModal = pobjEvent.isLookupModal;
    if (pobjEvent.eleId != null) {
      let psInputKey = this.bmlfGetInputColumn(pobjEvent.field);
      let parrFilterData = [];
      if (psInputKey && pobjEvent.searchValue != null) {
        parrFilterData = pobjEvent.gridData.filter(obj => obj[psInputKey].toString().toUpperCase() == (pobjEvent.searchValue != null ? pobjEvent.searchValue.toUpperCase() : ''));
      }
      // console.log(pos);
      if (parrFilterData.length == 0 || pobjEvent.searchValue == null) {
        //Bug 185572
        if (pobjEvent.field == 'ItemType' || pobjEvent.field == 'ItemSubType') {
          this.mArrGrid[this.mnumLineItemRowIndex][pobjEvent.field] = "";
          document.getElementById(pobjEvent.eleId).focus();
        }
        //Bug 185572
        else if (pobjEvent.field == 'BPGroupIfNoBPS' || pobjEvent.field == 'BPGroupIfNoMat') {
          this.mobjModal[pobjEvent.field] = '';
        } else {
          this.mobjModalPID[pobjEvent.field] = '';
          this.mobjPIDDescModal[pobjEvent.field + 'Desc'] = '';
        }
      }
      //  document.getElementById(pobjEvent.eleId).focus();
    }
  }
