  // So Footer Action finction
  bmlfFooterActionFn(evt) {
    debugger;
    let event = evt.type;
    this.mobjCommonFormObject = evt.formObject;
    if (event == 'searchEvn') {
      if (this.mbIsChangeData || this.FieldExtender.mbChange == true || this.customCtrl.mbChange == true) {
        this.mbSaveDialogView = true;
        this.mbIsSearchMode = true;
        return false;
      }
      this.bmlfOpenLookupModal('SupplementaryFile', this.msScreenName, 'SupplementaryFileList', 'click', '', 'custom', 'cmdSearch', 'SUPPLEMENTARYFILE.TITLE');
    } else if (event == 'addEvn') {
      if (!this.utilService.mbWrite) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.PERMISSION_WRITE'));
        return false;
      }
      ;
      if (!this.bmlfValidData()) {
        return;
      }
      if (this.mbIsChangeData || this.FieldExtender.mbChange == true || this.customCtrl.mbChange == true) {
        this.mbSaveDialogView = true;
        this.mbIsAddMode = true;
        return false;
      }
      this.bmlfRefreshForm();
    } else if (event == 'deleteEvn') {
      if (!this.utilService.mbDelete) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.PERMISSION_DELETE'));
        return false;
      }
      ;
      if (this.mobjSupplementaryFile.KeyID == '' && this.msFormMode == "I" && this.msCopyRecord == "N" && !this.mbIsChangeData && this.FieldExtender.mbChange == false && this.customCtrl.mbChange == false) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.MSG.NODATADELETE'));
        return false;
      }
      if (this.mobjSupplementaryFile.KeyID == '' && this.msFormMode == "I" && this.msCopyRecord == "Y" && !this.mbIsChangeData && this.FieldExtender.mbChange == false && this.customCtrl.mbChange == false) {
        this.bmlfRefreshForm();
        return false;
      }
      this.mbShowDeleteDialog = true;
    } else if (event == 'copyEvn') {
      if (!this.utilService.mbWrite) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.PERMISSION_WRITE'));
        return false;
      }
      ;
      if (src_app_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_1__.CustomValidator.bmgfNullCheckValidator(this.mobjSupplementaryFile.KeyID)) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate("COMMON.MSG.COPY"));
        document.getElementById("txtGrpName").focus();
        return;
      }
      if (this.mbIsChangeData || this.FieldExtender.mbChange == true || this.customCtrl.mbChange == true) {
        this.mbSaveDialogView = true;
        this.mbIsCopyMode = true;
        return false;
      }
      this.bmlfCopyData();
    } else if (event == 'closeEvn') {
      this.bmlfCloseForm();
    } else if (event == 'saveEvn') {
      this.bmlfSubmitData();
    }
  }
